cnt = 3


def fibo(a1, a2):
    global cnt
    temp = a1 + a2
    if (temp / (pow(10,999))) > 1:
        print("answer : %d" % (cnt-1))
        return -1

    cnt += 1

    return temp


if __name__ == "__main__":
    global cnt
    a1 = 1
    a2 = 1

    print("F1 = 1\n")
    print("F2 = 1\n")
    while(1):
        temp = fibo(a1, a2)
        print("F{} = {}\n".format(cnt-1, temp))
        if temp == -1:
            break
        else:
            a1 = a2
            a2 = temp

